DROP TABLE IF EXISTS `historique_concessionnaire`;
CREATE TABLE IF NOT EXISTS `historique_concessionnaire` (
  `type` varchar(60) NOT NULL,
  `gain` varchar(100) NOT NULL,
  `identifier` varchar(46) DEFAULT NULL,
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `cost` varchar(11) DEFAULT NULL,
  `date` varchar(255) DEFAULT NULL,
  `vehicle` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=442 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


CREATE TABLE `automatisation` (
  `society_concess` varchar(60) NOT NULL,
  `statut` varchar(100) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



ALTER TABLE `automatisation`
  ADD UNIQUE KEY `society_concess` (`society_concess`);
COMMIT;




